import React, { Component } from 'react';
import iconeClock from './icone-clock.png';
import $ from "jquery";
import {
    MapContainer,
    TileLayer,
    useMap,
  } from 'https://cdn.esm.sh/react-leaflet'

const defaultProps = {
    center: {
      lat: 10.99835602,
      lng: 77.01502627
    },
    zoom: 11
};

class RegistroPontoLocalizacao extends React.Component {

    constructor(props) {
        super(props);
        this.state = { date: new Date() };
    }

    registrar() {
        $.ajax({
            url: 'http://localhost:8080/registroPonto/lista',
            type: 'GET',
            success: function(result) {
                console.log(result)
            }
        });
    }

    render() {
        return (
            <div> 
                <h3>Obtenha sua localização</h3>
                <span>Permita acesso no seu navegador.</span>
                <GoogleMapReact
                    bootstrapURLKeys={{ key: "" }}
                    defaultCenter={defaultProps.center}
                    defaultZoom={defaultProps.zoom}
                />
            </div>
        );
    }
}

export default RegistroPontoLocalizacao;
